import {Link} from 'react-router-dom';

class Header extends React.Component {
    render(){
        return(
            <div>
                <div className = "header">
                    <right><ul class="header-ul">
                    <li class="header-li"><Link to ="/">Numerical Method</Link></li>
                    <li class="header-li"><a href="#home">Home</a></li>
                    <li class="header-li"><a href="#news">News</a></li>
                    <li class="header-li"><a href="#contact">Contact</a></li>
                    <li class="header-li"><a href="#about">About</a></li>
                </ul></right>
                </div>

            </div>
        )
    }
}

export default Header;
